import React from "react";

interface Item {
  title: string;
}

interface RoadmapCardPorps {
  data: {
    id: number;
    heading: string;
    title: string;
    des: string;
    content: Item[];
  };
}

export const RoadmapCard = ({ data }: RoadmapCardPorps) => {
  return (
    <div>
      <h5>{data.heading}</h5>
      <p>{data.title}</p>
      <p>{data.des}</p>
      {data.content.length > 0 &&
        data.content.map((subContent, index) => (
          <p key={index}>{subContent.title}</p>
        ))}
    </div>
  );
};
